import React from "react";
import "./AddUser.css";

const AddUser = () => {
  return (
    <form className="add-user-form">
      <label for="add-user-name">Name</label>
      <input type="text" className="add-user-name" id="add-user-name" />
      <input type="text" className="add-user-age" />
      <button type="submit" className="add-user-submit">
        Submit
      </button>
    </form>
  );
};

export default AddUser;
